import React from 'react'

import './Miniature.css'

export default function Miniature({id,name, tag , url,vue,like,addVue}) {

   
    return (
        <div className='card'>
              <video onClick= {()=>addVue(id)}>
                    <source src={require(`../video/${url}`).default}
                    type="video/mp4"></source>
               </video>
               <h3>{name}</h3>
                <p>nombre de vue:{vue}</p>
                <p>nombre de like:{like}</p>
        </div>
    )
}
